import React from 'react';
import Header from './statics/header';
import HomeBanner from './statics/homebanner';
import ProductFeature from './statics/productfeature';


import './App.css';

function App() {
  return (
    <react-fragment> 
      <Header/>  
      <HomeBanner/>
      <ProductFeature/>
    </react-fragment>
  );
}

export default App;
